import { Link } from "react-router-dom";
import { ListGroup } from "react-bootstrap"

function Navbar() {
  return (
    <ListGroup horizontal>
      <ListGroup.Item active>
        <Link className="text-white" to="/">Home</Link>
      </ListGroup.Item>
      <ListGroup.Item>
        <Link className="text-white" to="/about">About</Link>
      </ListGroup.Item>
      <ListGroup.Item>
        <Link className="text-white" to="/topics">Topics</Link>
      </ListGroup.Item>
      <ListGroup.Item>
        <Link className="text-white" to="/exercises">Exercises List</Link>
      </ListGroup.Item>
    </ListGroup>
  );
}

export default Navbar;
